const AuthPage = () => (
  <div return className="AuthPage">
    <form>
      <label htmlFor="login">Login:</label>
      <br />
      <input type="text" name="login" id="login" />
      <label htmlFor="password">
        <input type="text" name="password" id="password" />
      </label>
    </form>
  </div>
);

export default AuthPage;
